import './index.css';
const container = document.getElementById('menu-container');
const gameContainer = document.getElementById('game-container');
const packshot = document.getElementById('packshot');

const bananaMenu = document.getElementById('banana-menu');

const button = document.getElementById('button');

const hand = document.getElementById('hand');
const gameHand = document.getElementById('game-hand');

const yellowColor = document.getElementById('yellow-color');
const purpleColor = document.getElementById('purple-color');
const blueColor = document.getElementById('blue-color');

let isColorSelected = false;

const bananaYellowImg = 'data:image/png;base64,';
const bananaBlueImg = 'data:image/png;base64,';
const bananaPurlpleImg = 'data:image/png;base64,';

//music

let isPlaying = false;

const music = new Howl({
  src: 'data:audio/mpeg;base64,',
  volume: 0.3,
  loop: true,
})

const chooseColorSound = new Howl({
  src: 'data:audio/mpeg;base64,',
})

const slap = new Howl({
  src: 'data:audio/mpeg;base64,',
  volume: 1.2
})

document.addEventListener('visibilitychange', function () {
  if (document.visibilityState === 'visible') {
    music.play();
  } else {
    music.pause();
  }
});

let opts = {
  image: bananaYellowImg,
  gravity: 700,
  friction: 0.9,
  bounce: 0.5,
  pointsX: 15,
  pointsY: 15,
  renderCloth: false,
  mouseInfluence: 60,
  pinCorners: true,
};

const colors = [
  yellowColor,
  purpleColor,
  blueColor
]

function chooseBananaColor() {
  if (!isPlaying) music.play();
  isColorSelected = true;
  chooseColorSound.play();
  bananaMenu.className = '';
  hand.classList.replace('hand-animation-choose-color', 'hand-animation-touch-color');
  switch (this) {
    case yellowColor:
      bananaMenu.classList.add('banana-yellow-image');
      opts.image = bananaYellowImg;
      break;
    case purpleColor:
      bananaMenu.classList.add('banana-purple-image');
      opts.image = bananaPurlpleImg;
      break;
    case blueColor:
      bananaMenu.classList.add('banana-blue-image');
      opts.image = bananaBlueImg;
      break;
  }
  isPlaying = true;
}

function buttonHandler() {
  dapi.openStoreUrl();
}

window.onload = function () {
  (dapi.isReady()) ? onReadyCallback() : dapi.addEventListener("ready", onReadyCallback);
  //Here you can put other code that not related to dapi logic
}
function start() {
  function startGame() {
    if (isColorSelected) {
      gameContainer.classList.remove('hide');
      container.classList.add('hide');
      showGame();
    }
  }
  colors.forEach(color => color.onclick = chooseBananaColor);
  bananaMenu.onclick = startGame;
  hand.onclick = startGame;
};

//game 

function showGame() {
  let mesh;
  let cloth;
  let spacingX;
  let spacingY;
  let accuracy = 1;
  let touchCount = 0;
  const maxTouches = 8;
  const bananaInnerX = 35;
  const bananaInnerY = 150;

  function getOrientation() {
    return window.innerWidth > window.innerHeight ? "landscape" : "portrait";
  }

  const calculateSize = {
    ratio: gameContainer.offsetWidth / 411,
    calculateWidth: function (innerWidth) {
      if (getOrientation() === 'portrait') {
        return innerWidth * this.ratio;
      } else {
        return innerWidth * this.ratio;
      }
    },
    calculateHeight: function (innerHeight) {
      if (getOrientation() === 'portrait') {
        return innerHeight * this.ratio;
      } else {
        return innerHeight * this.ratio;
      }
    },
    calculateX: function (innerX) {
      if (getOrientation() === 'portrait') {
        return innerX * this.ratio;
      } else {
        return innerX * this.ratio;
      }
    },
    calculateY: function (innerY) {
      if (getOrientation() === 'portrait') {
        return innerY * this.ratio;
      } else {
        return innerY * this.ratio;
      }
    }
  }
  let canvas = document.createElement('canvas');
  canvas.id = 'canvasImg';
  let ctx = canvas.getContext('2d');
  canvas.classList.add('game-canvas-2');
  canvas.id = 'canvasImg';

  gameContainer.appendChild(canvas);

  ctx.strokeStyle = '#555';

  let mouse = {
    button: null,
    down: false,
    x: 0,
    y: 0,
    px: 0,
    py: 1
  };

  /*////////////////////////////////////////*/

  let stage = new PIXI.Container();
  let renderer = PIXI.autoDetectRenderer(gameContainer.offsetWidth, gameContainer.offsetHeight, { transparent: true });
  renderer.view.classList.add('game-canvas-1');
  renderer.view.id = 'canvasCloth';
  gameContainer.insertBefore(renderer.view, canvas);
  renderer.render(stage);

  canvas.width = gameContainer.offsetWidth;
  canvas.height = gameContainer.offsetHeight;

  /*////////////////////////////////////////*/

  function loadTexture() {
    document.body.className = 'loading';

    let texture = new PIXI.Texture.fromImage(opts.image);

    if (!texture.requiresUpdate) { texture.update(); }

    texture.on('error', function () { console.error('AGH!'); });

    texture.on('update', function () {
      document.body.className = '';

      if (mesh) { stage.removeChild(mesh); }

      mesh = new PIXI.mesh.Plane(this, opts.pointsX, opts.pointsY);

      mesh.width = this.width;
      mesh.height = this.height;

      if (getOrientation() === 'portrait') {
        if (calculateSize.ratio > 2.4) {
          spacingX = calculateSize.calculateWidth(this.width / 1.3) / (opts.pointsX - 1);
          spacingY = calculateSize.calculateHeight(this.height / 1.3) / (opts.pointsY - 1);
        } else {
          spacingX = calculateSize.calculateWidth(this.width) / (opts.pointsX - 1);
          spacingY = calculateSize.calculateHeight(this.height) / (opts.pointsY - 1);
        }
      } else {
        if (calculateSize.ratio > 2.4) {
          spacingX = calculateSize.calculateWidth(this.width / 2.5) / (opts.pointsX - 1);
          spacingY = calculateSize.calculateHeight(this.height / 2.5) / (opts.pointsY - 1);
        } else {
          spacingX = calculateSize.calculateWidth(this.width / 4) / (opts.pointsX - 1);
          spacingY = calculateSize.calculateHeight(this.height / 4) / (opts.pointsY - 1);
        }
      }

      cloth = new Cloth(opts.pointsX - 1, opts.pointsY - 1, !opts.pinCorners);
      stage.addChild(mesh);
    });
  }

  loadTexture(opts.image);

  (function update() {
    requestAnimationFrame(update);
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    if (cloth) { cloth.update(0.023); }
    renderer.render(stage);
  })(0);

  /*////////////////////////////////////////*/

  class Point {
    constructor(x, y) {
      this.x = x;
      this.y = y;
      this.px = x;
      this.py = y;
      this.vx = 0;
      this.vy = 0;
      this.pinX = null;
      this.pinY = null;

      this.constraints = [];
    }

    update(delta) {
      if (this.pinX && this.pinY) return this;

      if (mouse.down) {
        let dx = this.x - mouse.x + 30;
        let dy = this.y - mouse.y;

        let dist = Math.sqrt(dx * dx + dy * dy);

        if (mouse.button === 1 && dist < opts.mouseInfluence) {
          this.px = this.x - (mouse.x - mouse.px);
          this.py = this.y - (mouse.y - mouse.py);
        } else if (dist < mouse.cut) {
          this.constraints = [];
        }
      }

      this.addForce(0, opts.gravity);

      let nx = this.x + (this.x - this.px) * opts.friction + this.vx * delta;
      let ny = this.y + (this.y - this.py) * opts.friction + this.vy * delta;

      this.px = this.x;
      this.py = this.y;

      this.x = nx;
      this.y = ny;

      this.vy = this.vx = 0;

      if (this.x >= canvas.width) {
        this.px = canvas.width + (canvas.width - this.px) * opts.bounce;
        this.x = canvas.width;
      } else if (this.x <= 0) {
        this.px *= -1 * opts.bounce;
        this.x = 0;
      }

      if (this.y >= canvas.height) {
        this.py = canvas.height + (canvas.height - this.py) * opts.bounce;
        this.y = canvas.height;
      } else if (this.y <= 0) {
        this.py *= -1 * opts.bounce;
        this.y = 0;
      }
      return this;
    }

    draw() {
      let i = this.constraints.length;
      while (i--) this.constraints[i].draw();
    }

    resolve() {
      if (this.pinX && this.pinY) {
        this.x = this.pinX;
        this.y = this.pinY;
        return;
      }
      this.constraints.forEach(constraint => constraint.resolve());
    }

    attach(point) {
      this.constraints.push(new Constraint(this, point));
    }

    free(constraint) {
      this.constraints.splice(this.constraints.indexOf(constraint), 1);
    }

    addForce(x, y) {
      this.vx += x;
      this.vy += y;
    }

    pin(pinx, piny) {
      this.pinX = pinx;
      this.pinY = piny;
    }

    unpin() {
      this.pinX = null;
      this.pinY = null;
    }
  }
  /*////////////////////////////////////////*/

  class Constraint {
    constructor(p1, p2, length) {
      this.p1 = p1;
      this.p2 = p2;
      this.length = length || spacingX;
    }

    resolve() {
      let dx = this.p1.x - this.p2.x;
      let dy = this.p1.y - this.p2.y;
      let dist = Math.sqrt(dx * dx + dy * dy);

      if (dist < this.length) return;

      let diff = (this.length - dist) / dist;

      // if (dist > tearDist) this.p1.free(this)

      let mul = diff * 0.5 * (1 - this.length / dist);

      let px = dx * mul;
      let py = dy * mul;

      !this.p1.pinX && (this.p1.x += px);
      !this.p1.pinY && (this.p1.y += py);
      !this.p2.pinX && (this.p2.x -= px);
      !this.p2.pinY && (this.p2.y -= py);

      return this;
    }

    draw() {
      ctx.moveTo(this.p1.x, this.p1.y);
      ctx.lineTo(this.p2.x, this.p2.y);
    }
  }
  /*////////////////////////////////////////*/

  let count = 0;

  class Cloth {
    constructor(clothX, clothY, free) {
      this.points = [];
      let startX;
      let startY;

      if (getOrientation() === 'portrait') {
        if (calculateSize.ratio > 2.4) {
          startX = calculateSize.calculateX(80);
          startY = calculateSize.calculateY(210);
        } else {
          startX = calculateSize.calculateX(bananaInnerX);
          startY = calculateSize.calculateY(bananaInnerY);
        }
      } else {
        if (calculateSize.ratio > 2.4) {
          startX = calculateSize.calculateX(150);
          startY = calculateSize.calculateY(80);
        } else {
          startX = calculateSize.calculateX(170);
          startY = calculateSize.calculateY(50);
        }
      }

      for (let y = 0; y <= clothY; y++) {
        for (let x = 0; x <= clothX; x++) {
          let point = new Point(
            startX + x * spacingX - spacingX * Math.sin(y),
            y * spacingY + startY + (y !== 0 ? 2 * Math.cos(x) : 0));

          !free && y === 0 && point.pin(point.x, point.y);
          x !== 0 && point.attach(this.points[this.points.length - 1]);
          y !== 0 && point.attach(this.points[x + (y - 1) * (clothX + 1)]);

          this.points.push(point);
        }
      }
    }

    update(delta) {
      let i = accuracy;

      while (i--) {
        this.points.forEach(point => {
          point.resolve();
        });
      }

      ctx.beginPath();

      this.points.forEach((point, i) => {
        point.update(delta * delta);

        if (opts.renderCloth) { point.draw(); }

        if (mesh) {
          i *= 2;
          mesh.vertices[i] = point.x;
          mesh.vertices[i + 1] = point.y;
        }
      });
      ctx.stroke();
    }
  }

  function pointerMove(e) {
    let pointer = e.touches ? e.touches[0] : e;
    mouse.px = mouse.x || pointer.clientX;
    mouse.py = mouse.y || pointer.clientY;

    mouse.x = pointer.clientX;
    mouse.y = pointer.clientY;
  }

  function pointerDown(e) {
    mouse.down = true;
    mouse.button = 1;
    pointerMove(e);
    slap.play();
    touchCount++;
    if (touchCount == 1) {
      gameHand.classList.add('hide');
    }
    if (touchCount == maxTouches) endGame();
  }

  function pointerUp(e) {
    mouse.down = false;
    mouse.px = null;
    mouse.py = null;
  }

  document.body.addEventListener('mousedown', pointerDown);
  document.body.addEventListener('touchstart', pointerDown);

  document.body.addEventListener('mousemove', pointerMove);
  document.body.addEventListener('touchmove', pointerMove);

  document.body.addEventListener('mouseup', pointerUp);
  document.body.addEventListener('touchend', pointerUp);
  document.body.addEventListener('mouseleave', pointerUp);
  button.onclick = buttonHandler;
}

function endGame() {
  gameContainer.classList.add('blur');
  packshot.classList.add('unblur');
  packshot.classList.remove('hide');
  packshot.onanimationend = () => button.classList.add('button-animation');
}
start();

function onReadyCallback() {
  //No need to listen to this event anymore
  dapi.removeEventListener("ready", onReadyCallback);
  let isAudioEnabled = !!dapi.getAudioVolume();
  setAudioVoluem(isAudioEnabled);
  //If the ad is visible start the game
  dapi.isViewable() ? startGame() : false;

  //Use dapi functions
  dapi.addEventListener("viewableChange", viewableChangeCallback);
  dapi.addEventListener("audioVolumeChange", audioVolumeChangeCallback);
}

